import  logo from "../media/logo.png" ;
import { Link } from "react-router-dom";


export default function Navbar() {

 
  return (
    <div className="navbar">
        <div className="navbar__logo"><img src={logo} alt="logo" /></div>

        <ul className="navbar__links">
          
        </ul>   
    </div>
  )
}
